// Store moderators in memory (initialize empty)
const moderators = new Set();

// Helper function to normalize phone numbers for comparison
function normalizeNumber(number) {
  // Remove any non-digit characters
  let normalized = number.replace(/\D/g, '');
  // If the number starts with '0', replace with country code (assuming 254 for Kenya)
  if (normalized.startsWith('0')) {
    normalized = '254' + normalized.substring(1);
  }
  return normalized;
}

const mod = async (m, sock) => {
  const prefix = config.PREFIX;
  const cmd = m.body.startsWith(prefix) ? m.body.slice(prefix.length).split(' ')[0].toLowerCase() : '';
  const text = m.body.slice(prefix.length + cmd.length).trim();
  const args = text.split(' ');
  const sender = m.sender;

  if (cmd === "mod") {
    // Normalize both numbers for comparison
    const normalizedSender = normalizeNumber(sender.split('@')[0]);
    const normalizedOwner = normalizeNumber(config.OWNER_NUMBER.split('@')[0]);
    
    // Check if user is bot owner
    if (normalizedSender !== normalizedOwner) {
      await m.React('');
      return sock.sendMessage(m.from, { 
        text: ` *Owner Only*: You are not authorized to use this command.\n\n` +
              `Your number: ${normalizedSender}\n` +
              `Owner number: ${normalizedOwner}`
      }, { quoted: m });
    }

    const subCmd = args[0]?.toLowerCase();
    
    try {
      switch (subCmd) {
        case 'add': {
          if (args.length < 2) {
            await m.React('');
            return sock.sendMessage(m.from, { text: " *Usage*: `mod add @user` or `mod add 1234567890`" }, { quoted: m });
          }
          
          let userToAdd = args[1];
          // Handle if mentioned (@user)
          if (m.message?.extendedTextMessage?.contextInfo?.mentionedJid) {
            userToAdd = m.message.extendedTextMessage.contextInfo.mentionedJid[0];
          } else if (!userToAdd.includes('@')) {
            userToAdd += '@s.whatsapp.net';
          }
          
          if (moderators.has(userToAdd)) {
            await m.React('');
            return sock.sendMessage(m.from, { text: " User is already a moderator." }, { quoted: m });
          }
          
          moderators.add(userToAdd);
          await m.React('');
          return sock.sendMessage(m.from, { 
            text: ` *Moderator Added*\nUser: *${userToAdd.split('@')[0]}* can now use super user commands.`
          }, { quoted: m });
        }
        
        case 'del': {
          if (args.length < 2) {
            await m.React('');
            return sock.sendMessage(m.from, { text: " *Usage*: `mod del @user` or `mod del 1234567890`" }, { quoted: m });
          }
          
          let userToRemove = args[1];
          // Handle if mentioned (@user)
          if (m.message?.extendedTextMessage?.contextInfo?.mentionedJid) {
            userToRemove = m.message.extendedTextMessage.contextInfo.mentionedJid[0];
          } else if (!userToRemove.includes('@')) {
            userToRemove += '@s.whatsapp.net';
          }
          
          if (!moderators.has(userToRemove)) {
            await m.React('');
            return sock.sendMessage(m.from, { text: " User is not a moderator." }, { quoted: m });
          }
          
          moderators.delete(userToRemove);
          await m.React('');
          return sock.sendMessage(m.from, { 
            text: ` *Moderator Removed*\nUser: *${userToRemove.split('@')[0]}* can no longer use super user commands.`
          }, { quoted: m });
        }
        
        case 'list': {
          if (moderators.size === 0) {
            await m.React('');
            return sock.sendMessage(m.from, { 
              text: " *Moderators List*\nThere are no moderators currently (only owner has access)."
            }, { quoted: m });
          }
          
          const modList = Array.from(moderators)
            .map(mod => ` *${mod.split('@')[0]}*`)
            .join('\n');
          
          await m.React('');
          return sock.sendMessage(m.from, { 
            text: ` *Current Moderators*\n${modList}\n\n*Total*: ${moderators.size} moderator(s)`
          }, { quoted: m });
        }
        
        default: {
          await m.React('');
          return sock.sendMessage(m.from, { 
            text: ` *Moderator Management*\n\n` +
                  `*mod add <user>* - Grant moderator access\n` +
                  `*mod del <user>* - Revoke moderator access\n` +
                  `*mod list* - Show current moderators\n\n` +
                  `Only the bot owner (${normalizedOwner}) can use these commands.`
          }, { quoted: m });
        }
      }
    } catch (error) {
      console.error(error);
      await m.React('');
      return sock.sendMessage(m.from, { 
        text: " Error: Failed to process moderator command. Please try again."
      }, { quoted: m });
    }
  }
}

// Helper function to check if a user has elevated privileges
export function isPrivileged(user) {
  const normalizedUser = normalizeNumber(user.split('@')[0]);
  const normalizedOwner = normalizeNumber(config.OWNER_NUMBER.split('@')[0]);
  return normalizedUser === normalizedOwner || moderators.has(user);
}

export default mod;
